message:
⚠️ DICAS

🚨 OBSERVEM,...
🚨 QUESTIONEM &...
🚨 FAÇAM =

✅ IDENTIFICAR na FARDA & PERGUNTAR ao Militar
(Vale p/PM, MP, MPF, todos!):
* Nome com um Sobrenome;
* Designação q faz parte;
* Qualificação;

✅ PERGUNTAR (Questionar)
SOBRE A ORDEM:
* Responsável pela ordem;
* Onde e quando foi publicado tal "ordem";
* Contatos do Setor que expediu essa determinação. Sim, para confrontar com as informações do suposto grupamento q o Militar diz fazer parte.

✅ FAÇAM VÍDEOS.
Informando data, local e hora;

TENHAM A CERTEZA. Impostores desviam o foco para vcs não questionarem como não vão responder todas as perguntas e/ou responderam informações erradas. 

🚨 CUIDADO, ATENÇÃO & OBSERVAÇÃO SEMPRE 🫡
